import React, { useState } from "react";
import {
  Box,
  Button,
  Container,
  Grid,
  IconButton,
  InputAdornment,
  TextField,
  Typography,
} from "@mui/material";
import { Visibility, VisibilityOff, CalendarToday } from "@mui/icons-material";

const Signup: React.FC = () => {
  const [showOtp, setShowOtp] = useState(false);

  const handleOtpVisibility = () => setShowOtp(!showOtp);

  return (
    <Container maxWidth="lg" sx={{ height: "100vh", display: "flex", alignItems: "center" }}>
      <Grid container spacing={2} sx={{ boxShadow: 3, borderRadius: 3, overflow: "hidden" }}>
        {/* Left Side - Signup Form */}
        <Grid item xs={12} md={6} sx={{ padding: 4 }}>
          <Typography variant="h4" fontWeight="bold" gutterBottom>
            Sign up
          </Typography>
          <Typography variant="body1" color="text.secondary" mb={4}>
            Sign up to enjoy the feature of HD
          </Typography>
          <Box component="form" noValidate autoComplete="off">
            <TextField
              label="Your Name"
              fullWidth
              margin="normal"
              variant="outlined"
            />
            <TextField
              label="Date of Birth"
              fullWidth
              margin="normal"
              variant="outlined"
              InputProps={{
                endAdornment: (
                  <InputAdornment position="end">
                    <CalendarToday />
                  </InputAdornment>
                ),
              }}
            />
            <TextField
              label="Email"
              fullWidth
              margin="normal"
              variant="outlined"
              type="email"
            />
            <TextField
              label="OTP"
              fullWidth
              margin="normal"
              variant="outlined"
              type={showOtp ? "text" : "password"}
              InputProps={{
                endAdornment: (
                  <InputAdornment position="end">
                    <IconButton onClick={handleOtpVisibility}>
                      {showOtp ? <VisibilityOff /> : <Visibility />}
                    </IconButton>
                  </InputAdornment>
                ),
              }}
            />
            <Button
              variant="contained"
              fullWidth
              sx={{ marginY: 2, paddingY: 1.5 }}
            >
              Sign up
            </Button>
          </Box>
          <Typography align="center" variant="body2">
            Already have an account?{" "}
            <Typography
              component="span"
              color="primary"
              sx={{ cursor: "pointer" }}
            >
              Sign in
            </Typography>
          </Typography>
        </Grid>

        {/* Right Side - Image */}
        <Grid
          item
          xs={12}
          md={6}
          sx={{
            backgroundImage: "url('/assets/images/signup-bg.jpg')",
            backgroundSize: "cover",
            backgroundPosition: "center",
          }}
        ></Grid>
      </Grid>
    </Container>
  );
};

export default Signup;
